import React from 'react'

export default function Student(props) {
    return (
        <li>
            <b>ID:</b>
            {props.data.id} <b>First_name:</b> {props.data.first_name} <b>Last_name:</b>
            {props.data.last_name} <b>Email:</b>
            {props.data.email}
        </li>
    )
}
